
(function () {
    var xAlert = function (message, msgType) {
        var id = 'xAlert';
        var styleid = 'alertStyle';
        var boxClass = 'xAlert';
        var type = (msgType == 'error') ? 'error' : 'success';
        var btnName = '关闭';
        var audioSource = (msgType == 'error') ? "data:audio/wav;base64," : "data:audio/wav;base64,";
        var msg = message || "";
        var tmpl = '<div class="a-left"><div class="a-imgbox ' + type + '"></div></div><div class="a-center"><div class="c-left"><div class="a-desc">' + msg + '</div></div></div><div class="a-right"></div>';

        var style = '#xAlert{position:fixed;max-height:100%;overflow:auto;top:0;margin-top:70px;right:15px;width:240px;color:#FFF;padding-left:5px;padding-right:5px;font-family:"Microsoft YaHei",STHeiti,Arial,sans-serif;z-index:99999;}#xAlert .xAlertHide{ height:50px !important;overflow:hidden;background:#78cd51; border-left:4px solid #60b439;margin-bottom:20px;transition-duration:.5s;opacity:1;height:auto;}#xAlert .xAlertHide.alertHide{margin-bottom:0!important;height:0!important;opacity:0!important;}#xAlert .xAlert{width:100%;}#xAlert .xAlert .a-left{ float:left;width:36px;padding:7px 10px;}#xAlert .xAlert .a-left .a-imgbox{width:36px;height:36px;text-align:center;line-height:36px;border-radius:50% !important;font-size:20px;display:inline-block;color:#fff;background:#FFF;}#xAlert .xAlert .a-left .a-imgbox:after{ display:block; margin:8px auto; background:url(/Content/images/sprites_alert.png) no-repeat 0 0; width:24px; height:20px;content:" ";}#xAlert .xAlert .a-left .a-imgbox.error{}#xAlert .xAlert .a-left .a-imgbox.error:after{ width:3px; background-position:-24px 0;}#xAlert .xAlert .a-center{ float:left;}#xAlert .xAlert .a-center .a-desc{word-break:break-all;word-wrap:break-word;line-height:48px;font-size:18px;text-align:justify;}#xAlert .xAlert .a-center .c-left{}#xAlert .xAlert .a-right{ float:right; height:50px;}#xAlert .xAlert .a-right .a-close-btn{display:block;width:30px;text-align:center;cursor:pointer;height:50px;border:0;outline:0;transition-duration:.3s;color:#333;font-size:0; text-indent:-999em; overflow:hidden;background:0;padding:0;background:url(/Content/images/sprites_alert.png) no-repeat 0 -20px;}#xAlert .xAlert .a-right .a-close-btn:hover{background-color:rgba(255,255,255,.1);}#xAlert .xAlert .a-right .a-close-btn:active{background-color:rgba(255,255,255,.2);}';
        var body = document.querySelector('body');
        var head = document.querySelector('head');
        var styleSheets = document.getElementById(styleid);

        if (styleSheets === null) {
            styleSheets = document.createElement('style');
            styleSheets.id = styleid;
            styleSheets.innerHTML = style;
            head.appendChild(styleSheets);
        }

        var box = document.getElementById(id);

        if (box === null) {
            box = document.createElement('div');
            box.id = id;
            body.appendChild(box);
        }

        var alertHide = document.createElement('div');
        alertHide.className = 'xAlertHide';

        var alert = document.createElement('div');
        alert.className = boxClass;
        alertHide.appendChild(alert);
        alert.innerHTML = tmpl;

        var audioBox = alert.querySelector('.c-left');
        var audio = document.createElement('audio');
        audio.setAttribute('src', audioSource);
        audio.setAttribute('autoplay', 'autoplay');
        audioBox.appendChild(audio);

        var btnBox = alert.querySelector('.a-right');
        var btn = document.createElement('button');
        btn.className = 'a-close-btn';
        btn.setAttribute('type', 'button');
        btn.innerHTML = btnName;
        btn.addEventListener('click', function () {
            var self = this;
            var alertBox = self.parentNode.parentNode
            var hideBox = alertBox.parentNode;
            var height = hideBox.offsetHeight;
            hideBox.style.height = height + 'px';
            var classname = hideBox.className;
            hideBox.className = classname + ' alertHide';
            setTimeout(function () {
                alertBox.remove(hideBox);
            }, 500);
        })
        btnBox.appendChild(btn);

        var firstAlert = box.querySelector(".xAlertHide");
        box.insertBefore(alertHide, firstAlert);

        var height = alertHide.offsetHeight;
        alertHide.style.height = height + 'px';
        var timer = null;
        timer = setTimeout(function () {
            var classname = alertHide.className;
            alertHide.className = classname + ' alertHide';
            setTimeout(function () {
                alertHide.remove(alertHide);
                if (box.childNodes.length == 0) {
                    box.remove(box);
                }
            }, 800);
        }, 4000);
        alertHide.addEventListener('mouseenter', function () {
            clearTimeout(timer);
        })
        alertHide.addEventListener('mouseleave', function () {
            timer = setTimeout(function () {
                var classname = alertHide.className;
                alertHide.className = classname + ' alertHide';
                setTimeout(function () {
                    alertHide.remove(alertHide);
                    if (box.childNodes.length == 0) {
                        box.remove(box);
                    }
                }, 800);
            }, 2000);
        });
    }
    window.xAlert = xAlert;
})();